import { Location } from '@angular/common';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { BalanceService } from 'src/app/services/balance.service';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { SettleUpComponent } from '../settle-up/settle-up.component';
import { BalanceDTO } from '../dto';
import { ExpenseService } from 'src/app/services/expense.service';

@Component({
  selector: 'app-balance',
  templateUrl: './balance.component.html',
  styleUrls: ['./balance.component.css'],
})
export class BalanceComponent implements OnInit {
  balances!: BalanceDTO[];
  currencies!: string[]
  groupId!: number;

  constructor(
    private balanceService: BalanceService,
    private expenseService: ExpenseService,
    private route: ActivatedRoute,
    private location: Location,
    private modalService: NgbModal
  ) {}
  ngOnInit(): void {
    this.groupId = parseInt(this.route.snapshot.paramMap.get('id') ?? '');
    this.balanceService
      .getMyBalancesByGroupId(this.groupId)
      .subscribe((response) => {
        console.log('balances: ', response);
        this.balances = response;
      });

      this.expenseService.getCurrencies().subscribe(response=>this.currencies = response)
  }

  goBack() {
    this.location.back();
  }

  openModal(payerId: number, payerUsername: string, recieverId: number, recieverUsername: string, amount: number, currency: string, balanceId: number){
    const modalRef = this.modalService.open(SettleUpComponent, { centered: true, backdrop: 'static' });
		modalRef.componentInstance.payerId = payerId;
		modalRef.componentInstance.payerUsername = payerUsername;
		modalRef.componentInstance.recieverUsername = recieverUsername;
		modalRef.componentInstance.initialAmount = amount;
		modalRef.componentInstance.initialCurrency = currency;
		modalRef.componentInstance.balanceId = balanceId;
		modalRef.componentInstance.currencies = this.currencies;
		modalRef.componentInstance.groupId = this.groupId;
  }
}
<div class="row mb-4 mt-2">
  <div class="col-auto">
    <button
      type="button"
      class="btn btn-primary rounded-circle"
      title="Back"
      (click)="goBack()"
    >
      <i class="bi bi-arrow-left" style="font-size: 1.5rem; color: white"></i>
    </button>
  </div>
  <div class="col">
    <h1 class="text-center">Wich balance do you want to settle?</h1>
  </div>
</div>
<div class="row d-flex justify-content-center">
  <div class="col-md-8">
    <ng-container *ngFor="let balance of balances">
      <ng-container *ngFor="let youOweByCurrency of balance.youOwe">
        you owe
        <app-balance-card
          [payerId]="balance.you.id"
          [payerUsername]="balance.you.username"
          [recieverId]="balance.other.id"
          [recieverUsername]="balance.other.username"
          [amount]="youOweByCurrency.amount"
          [currency]="youOweByCurrency.currency"
          (click)="openModal(balance.you.id, balance.you.username, balance.other.id, balance.other.username, youOweByCurrency.amount, youOweByCurrency.currency, balance.id)"
        ></app-balance-card>
      </ng-container>
      <ng-container *ngFor="let youAreOwedByCurrency of balance.youAreOwed">
        you are owed
        <app-balance-card
          [payerId]="balance.other.id"
          [payerUsername]="balance.other.username"
          [recieverId]="balance.you.id"
          [recieverUsername]="balance.you.username"
          [amount]="youAreOwedByCurrency.amount"
          [currency]="youAreOwedByCurrency.currency"
          (click)="openModal(balance.other.id, balance.other.username, balance.you.id, balance.you.username, youAreOwedByCurrency.amount, youAreOwedByCurrency.currency, balance.id)"
        ></app-balance-card>
      </ng-container>
    </ng-container>
  </div>
</div>
